每个bean都有一个或多个标识符，这些标识符在托管bean的容器中必须是唯一的，bean通常只有一个标识符但是可以定义多个标识符，这些标识符称为别名。
在bean定义本身可以为bean提供多个名称，但是使用id属性指定的最多一个名称而使用name属性可以指定任意多个名称。这些名称是同一个bean的等效别名，

name
对某些情况很有用，例如让应用程序中的每个组件通过使用特定于该组件本身的bean名称来引用公共依赖项。
alias
name指定实际定义bean的所有别名并不总是足够的。有时需要为其他地方定义的bean引入别名。在大型系统中通常就是这种情况，其中配置在每个子系统之间分配，每个子系统具有其自己的一组对象定义。在基于XML的配置元数据中，您可以使用该元素来完成此任务。以下示例显示了如何执行此操作:




