propertyeditor.html.body:
PropertyEditor是JDK提供的用于Bean的属性值编辑,
支持各种不同类型转换或者更新属性值的方法，它定义了Bean的属性值类型转换或者更新的接口，在使用过程中通过对setAsText或者setValue调用进行转换或者更新值，然后通过getValue返回修改后的值。

当参数对象属于相应的propertyEditor类型时，每个属性编辑器都必须支持对setValue的调用(获取属性值通过getValue)。此外，每个属性编辑器必须支持自定义编辑器或支持setAsText(值类型为String调用，其它类型调用setValue) 如TypeConverterDelegate的doConvertValue方法



是线程不安全的，替代它的是线程安全ConversionService


使用方法
//通过解析给定的String来设置属性值。 如果String格式错误或者此类属性不能表示为文本
 public void setAsText(String text) throws java.lang.IllegalArgumentException {
        if (value instanceof String) {
            setValue(text);
            return;
        }
        throw new java.lang.IllegalArgumentException(text);
    }


//属性值如果是String 类型使用它
@Override
public void setAsText(String text) throws IllegalArgumentException {
    setValue(text);
}
//其它类型使用它
@Override
public void setValue(Object value) {
    super.setValue(value);
}


MutablePropertyValues pvs = new MutablePropertyValues();
//setAsText
pvs.addPropertyValue("a_1","1");

//setValue
pvs.addPropertyValue("a_1",1);


