如:ConfigurationClassParser创建ConfiggurationClass对象就是先通过类全限定名来获取它MetaDataRead信息


类的元数据信息包含了类的Resource,ClassMetadata,AnnotationMetadata

在spring一般是是通过MetadataReaderFactory来创建一个类的MetaDataReader实例的

public interface MetadataReader {
        //返回类文件的资源引用
    Resource getResource();
        //基础类的基本类元数据
    ClassMetadata getClassMetadata();
        //读取基础类的完整注释元数据，包括带注释方法的元数据
    AnnotationMetadata getAnnotationMetadata();

}


//如: MetadataReaderFactory 根据类的全限定名返回该类的元数据MetaDataReader
public MetadataReader getMetadataReader(String className) throws IOException {
        try {
            String resourcePath = ResourceLoader.CLASSPATH_URL_PREFIX +
                    ClassUtils.convertClassNameToResourcePath(className) + ClassUtils.CLASS_FILE_SUFFIX;
            Resource resource = this.resourceLoader.getResource(resourcePath);
            return getMetadataReader(resource);
        }

    }



       //resource 创建一个MetadataReader的SimpleMetadataReader实例
    @Override
    public MetadataReader getMetadataReader(Resource resource) throws IOException {
        return new SimpleMetadataReader(resource, this.resourceLoader.getClassLoader());
    }



// CachingMetadataReaderFactory 添加缓存元数据
private Map metadataReaderCache;
//默认Map
private static class LocalResourceCache extends LinkedHashMap {

        private volatile int cacheLimit;

        public LocalResourceCache(int cacheLimit) {
            super(cacheLimit, 0.75f, true);
            this.cacheLimit = cacheLimit;
        }

        public void setCacheLimit(int cacheLimit) {
            this.cacheLimit = cacheLimit;
        }

        public int getCacheLimit() {
            return this.cacheLimit;
        }

        @Override
        protected boolean removeEldestEntry(Map.Entry eldest) {
            return size() > this.cacheLimit;
        }
    }

