boot/SpringBootExceptionReporter/Failure.body:
FailureAnalyzer 接口定义用于分析故障并提供可以显示给用户的诊断信息。


通过抛出异常类型与当前异常分析类的类型比较来执行相应异常类的analyze分析,

如:BeanDefinitionOverrideFailureAnalyzer extends AbstractFailureAnalyzer 异常分析类中异常类型BeanDefinitionOverrideException

#AbstractFailureAnalyzer根据异常返回具体异常分析类
ResolvableType.forClass(AbstractFailureAnalyzer.class, getClass()).resolveGeneric();



private BeanDefinitionOverrideException createFailure(
        ApplicationContextInitializer initializer) {
    try {
        AnnotationConfigApplicationContext context = new AnnotationConfigApplicationContext();
        context.setAllowBeanDefinitionOverriding(false);
        initializer.initialize(context);
        context.refresh();
        context.close();
        return null;
    }
    catch (BeanDefinitionOverrideException ex) {
        return ex;
    }
}

private FailureAnalysis performAnalysis(Class configuration) {
    BeanDefinitionOverrideException failure = createFailure(configuration);
    assertThat(failure).isNotNull();
    return new BeanDefinitionOverrideFailureAnalyzer().analyze(failure);
}

FailureAnalysis analysis = performAnalysis((context) -> {
        context.registerBean("testBean", String.class, (Supplier) String::new);
        context.registerBean("testBean", String.class, (Supplier) String::new);
    });

String description = analysis.getDescription();


