@Target(ElementType.TYPE)
@Retention(RetentionPolicy.RUNTIME)
@Documented
@Inherited
@SpringBootConfiguration
@EnableAutoConfiguration
@ComponentScan(excludeFilters = { @Filter(type = FilterType.CUSTOM, classes = TypeExcludeFilter.class),
        @Filter(type = FilterType.CUSTOM, classes = AutoConfigurationExcludeFilter.class) })
public @interface SpringBootApplication {

    /**
     * Exclude specific auto-configuration classes such that they will never be applied.
     * @return the classes to exclude
     */
    @AliasFor(annotation = EnableAutoConfiguration.class)
    Class[] exclude() default {};

    /**
     * Exclude specific auto-configuration class names such that they will never be
     * applied.
     * @return the class names to exclude
     * @since 1.3.0
     */
    @AliasFor(annotation = EnableAutoConfiguration.class)
    String[] excludeName() default {};

    /**
     * Base packages to scan for annotated components. Use {@link #scanBasePackageClasses}
     * for a type-safe alternative to String-based package names.
     * 
     * Note: this setting is an alias for
     * {@link ComponentScan @ComponentScan} only. It has no effect on {@code @Entity}
     * scanning or Spring Data {@link Repository} scanning. For those you should add
     * {@link org.springframework.boot.autoconfigure.domain.EntityScan @EntityScan} and
     * {@code @Enable...Repositories} annotations.
     * @return base packages to scan
     * @since 1.3.0
     */
    @AliasFor(annotation = ComponentScan.class, attribute = "basePackages")
    String[] scanBasePackages() default {};

    @AliasFor(annotation = ComponentScan.class, attribute = "basePackageClasses")
   Class[] scanBasePackageClasses() default {};


    @AliasFor(annotation = Configuration.class)
    boolean proxyBeanMethods() default true;

}

@ComponentScan 扫描组件

未指定扫描路径basePackages or basePackageClasses ClassPathBeanDefinitionScanner 默认扫描当前声明类路径下由includeFilters指定的类型 默认@Component

如：扫描自定义类型

@interface MyAnnotation {
}

@Configuration
@ComponentScan(
    basePackageClasses = TestBean.class,
    nameGenerator = DefaultBeanNameGenerator.class,
    scopedProxy = ScopedProxyMode.NO,
    scopeResolver = AnnotationScopeMetadataResolver.class,
    resourcePattern = "**/*custom.class",
    useDefaultFilters = false,
    includeFilters = {
        @Filter(type = FilterType.ANNOTATION, value = MyAnnotation.class)
    },
    excludeFilters = {
        @Filter(type = FilterType.CUSTOM, value = TypeFilter.class)
    },
    lazyInit = true
)
class MyConfig {
}

