boot/SpringApplication.html.body:
SpringApplications是一个可用于从main方法引导和启动Spring应用程序的类，SpringApplications可以从各种不同的来源读取BeanDefinition。通常建议使用单个@Configuration类来引导您的应用程序 ，将执行以下步骤来引导您的应用程序

创建一个适当的ApplicationContext实例（取决于您的类路径）
注册一个命令属性源[CommandLinePropertySource][/beanfactory/PropertySource.md]以将命令行参数公开为Spring属性
刷新应用程序上下文，加载所有单例bean
触发任何CommandLineRunner bean
在大多数情况下，可以直接从主方法中调用静态run（Class，String []）方法来引导应用程序：


@Configuration
@EnableAutoConfiguration
public class MyApplication  {

 // ... Bean definitions

 public static void main(String[] args) {
   SpringApplication.run(MyApplication.class, args);
 }
}

main方法引导

public static void main(String[] args) {
 SpringApplication application = new SpringApplication(MyApplication.class);
 // ... customize application settings here
 application.run(args)
 }

