boot/ConfigurableEnvironment.html.body:
ConfigurableEnvironment
大多数（如果不是全部）环境类型都将实现配置接口。提供用于设置活动和默认配置文件以及操纵基础属性源的工具。允许客户端通过ConfigurablePropertyResolver超级接口设置和验证所需的属性，自定义转换服务以及其他功能。
处理财产来源
财产来源可能会被删除，重新排序或替换；并且可以使用从getPropertySources（）返回的MutablePropertySources实例添加其他属性源。以下示例与ConfigurableEnvironment的StandardEnvironment实现相反，但通常适用于任何实现，尽管特定的默认属性来源可能有所不同。
示例：添加具有最高搜索优先级的新属性源
   ConfigurableEnvironment环境=新的StandardEnvironment（）;
   MutablePropertySources propertySources = environment.getPropertySources（）;
   Map  myMap = new HashMap <>（）;
   myMap.put（“ xyz”，“ myValue”）;
   propertySources.addFirst（new MapPropertySource（“ MY_MAP”，myMap））;
示例：删除默认的系统属性属性源
   MutablePropertySources propertySources = environment.getPropertySources（）;
   propertySources.remove（StandardEnvironment.SYSTEM_PROPERTIES_PROPERTY_SOURCE_NAME）
示例：模拟系统环境以进行测试
   MutablePropertySources propertySources = environment.getPropertySources（）;
   MockPropertySource mockEnvVars = new MockPropertySource（）。withProperty（“ xyz”，“ myValue”）;
   propertySources.replace（StandardEnvironment.SYSTEM_ENVIRONMENT_PROPERTY_SOURCE_NAME，mockEnvVars）；
当ApplicationContext使用Environment时，在调用上下文的refresh（）方法之前执行任何此类PropertySource操作非常重要。这样可以确保在容器引导过程中所有属性源均可用，包括由属性占位符配置器使用。



