SpringApplication 在启动过程中通过ApplicationContextInitializer接口的实现类来配置上下文

ConfigurationWarningsApplicationContextInitializer
ConfigurationWarningsApplicationContextInitializer是一个ApplicationContextInitializer接口实现者 ,通过创建一个实现了BeanDefinitionRegistryPostProcessor接口的内部类来注册和获取所有BeanDefinition和检查被注解@ComponentScan修饰类未指定路径或者类的警告。如下:
@Configuration(proxyBeanMethods = false)
@ComponentScan
public class A {

}


try (AnnotationConfigApplicationContext context = new AnnotationConfigApplicationContext()) {
//检查BeanFactory中是否包含被@ComponentScan修饰的AnnotatedBeanDefinition 是否指定指定路径或者类
new ConfigurationWarningsApplicationContextInitializer().initialize(context);

//** WARNING ** : Your ApplicationContext is unlikely to start due to a @ComponentScan of the default package.

context.register(configClass);
context.refresh();


}


AnnotatedBeanDefinition

ContextIdApplicationContextInitializer 向Bean工程注册一个上下文IDContextId 类
public void initialize(ConfigurableApplicationContext applicationContext) {
    ContextId contextId = getContextId(applicationContext);
    applicationContext.setId(contextId.getId());
    applicationContext.getBeanFactory().registerSingleton(ContextId.class.getName(), contextId);
}


static class ContextId {

        private final AtomicLong children = new AtomicLong(0);

        private final String id;

        ContextId(String id) {
            this.id = id;
        }

        ContextId createChildId() {
            return new ContextId(this.id + "-" + this.children.incrementAndGet());
        }

        String getId() {
            return this.id;
        }

    }
DelegatingApplicationContextInitializer 委托在context.initializer.classes环境属性下指定的其他初始化程ApplicationContextInitializer
RSocketPortInfoApplicationContextInitializer 设置RSocketServer服务器实际监听的端口的环境属性。可以使用@Value将属性“ local.rsocket.server.port”直接注入测试中，也可以通过环境获取。
属性会自动传播到任何父上下文。
ServerPortInfoApplicationContextInitializer 设置WebServer服务器实际侦听的端口的环境属性。可以使用@Value将属性local.server.port直接注入测试中，也可以通过环境获取。
