boot/source/ConfigurationPropertySource..body:
ConfigurationPropertySource 是获取配置属性ConfigurationProperties接口

如:SpringConfigurationPropertySource

Map source = new LinkedHashMap<>();
source.put("key1", "value1");
source.put("key2", "value2");
source.put("key3", "value3");

//名称和原始属性源
PropertySource propertySource = new MapPropertySource("test", source);

//属性名和原始属性名-映射
TestPropertyMapper mapper = new TestPropertyMapper();
//属性名称
ConfigurationPropertyName name = ConfigurationPropertyName.of("my.key");
//属性映射 my.key = key2
mapper.addFromConfigurationProperty(name, "key2");
//字符串配置属性源
SpringConfigurationPropertySource adapter = new SpringConfigurationPropertySource(propertySource, mapper, null);
//根据属性名获取属性值

ConfigurationProperty cfig = adapter.getConfigurationProperty(name)
assertThat(cfg.getValue()).isEqualTo("value2");



ConfigurationProperty 类是单个配置属性，包括属性名称ConfigurationPropertyName，值和属性来源Origin。

ConfigurationPropertyName 由点分隔的元素组成的配置属性名称,如 spring.main.banner-modeserver.hosts[0].name,log[org.springboot].level

ConfigurationPropertyName name = ConfigurationPropertyName.of("foo.bar");
assertThat(name.toString()).isEqualTo("foo.bar");
assertThat(name.getElement(0, Form.ORIGINAL)).isEqualTo("foo");

